  false,\n\t\"url\": null,\n\t\"notes\": \" A tribal block group is a cluster of census
  tabulation blocks within a single tribal censusn               tract delineated
  by American Indian tribal participants or the Census Bureau for the purpose of presenting
  demographicn               data on their reservation and/or off-reservation trust
  land. The tribal block groups are defined independently of then               standard
  county-based block group delineation. For federally recognized American Indian Tribes
  with reservations and/orn               off-reservation trust lands with a population
  less than 1,200, a single tribal block group is defined. Qualifyingn               reservations
  and/or off-reservation trust lands with a population greater than 1,200 could define
  additional tribal blockn               groups within their area without regard to
  the standard block group configuration. Tribal block groups do not necessarilyn
  \              contain tabulation blocks always beginning with the same number and
  could contain seemingly duplicate block numbers.n               Tabulation block
  numbers are still assigned by using standard block groups, not the tribal block
  groups. To better identifyn               tribal block groups, the letter code range
  A through K (except I, which could be confused with a number 1) is used uniquelyn
  \              within each tribal census tract. The boundaries of tribal block groups
  and tribal census tracts are those delineated throughn               the Tribal
  Statistical Areas Program (TSAP) for the 2010 Census. \",\n\t\"license_title\":
